import Movies from '../components/Movies';


function PageFavs() {
    return (
        <section className="favs-page">
            <h2>Favourite Page</h2>

            <div className="favs-list">
                {moviesData !== null && <Movies movies={moviesData} />}
                <p></p>
            </div>
        </section>
    )
}

export default PageFavs;
